import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Button, LogoTitle } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import HomeScreen from './screens/HomeScreen';
import SearchCityScreen from './screens/SearchCityScreen';
import SearchCountryScreen from './screens/SearchCountryScreen';
import CityResultScreen from './screens/CityResultScreen';
import CountryResultScreen from './screens/CountryResultScreen';

const Stack = createNativeStackNavigator();

export default function App() {
  return (

      <NavigationContainer>
        <Stack.Navigator initialRouteName="Home">
          <Stack.Screen name="CityPop" component={HomeScreen} />
          <Stack.Screen name="SearchCity" component={SearchCityScreen} />
          <Stack.Screen name="SearchCountry" component={SearchCountryScreen} />
          <Stack.Screen name="CityResults" component={CityResultScreen} 
                  options={{
                    headerTitle: props => <LogoTitle {...props} />,
                    headerRight: () => (
                      <Button
                        onPress={() => alert('This is a button!')}
                        title="Info"
                        color="#fff"
                      />
                    ),
                  }}/>
          <Stack.Screen name="CountryResults" component={CountryResultScreen} />
        </Stack.Navigator>
      </NavigationContainer>


  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
